import axios from "axios";
const url = 'http://localhost:8080/contact'
class contactService {

  get = async () => {
    let result = await axios.get(`${url}/get`);
    return result.data;
  }
  getById = async (id) => {
    let result = await axios.get(`${url}/getById`, { params: { id } });
    return result.data;
  }

  post = async (contact) => {
    let result = await axios.post(`${url}/post`, contact);
    return result.data;
  }

  put = async (contact) => {
    let result = await axios.put(`${url}/put`, contact);
    return result.data;
  }

  deleted = async (id) => {
    let result = await axios.delete(`${url}/delete`, id);
    return result.data;
  }
  pictureUrl = (number, gender) => {
    return `https://randomuser.me/api/portraits/${gender}/${number}.jpg`
  }

  getPictureId = async () => {
    let number = Math.floor(Math.random() * 100)
    return number;
  }
}
export default new contactService();
